import React from 'react';

const App=()=> {
  return (
    <div >
      <header>
      <img src="" className="App-logo" alt="client" />
        <p>
          Client Registratio
        </p>
        <a
          className="App-link"
          href="https://accounts.google.com/signin/v2/identifier?hl=en&continue=https%3A%2F%2Fwww.google.com%2Fsearch%3Fq%3Dgmail%2Blogin%26oq%3Dgmail%2Blogin%26aqs%3Dchrome..69i57.4749j0j1%26sourceid%3Dchrome%26ie%3DUTF-8&ec=GAlAAQ&flowName=GlifWebSignIn&flowEntry=AddSession"
          target="_blank"
          rel="noopener noreferrer"
        >
          Login
        </a>
      </header>
    </div>
  );
} 

export default App;



